 Here's a simple bubble sort implementation in Python:
```python
def bubble_sort(L):
    n = len(L)
    for i in range(n):
        for j in range(0, n-i-1):
            # Swap if L[j] > L[j+1] for n-i-1 iterations
            if L[j] > L[j+1]:
                L[j], L[j+1] = L[j+1], L[j]
    return L
```
