 Here is a basic implementation of a Pascal's triangle in JavaScript:
```html
<html>
  <head>
    <meta charset="utf-8">
    <title>Pascal's Triangle</title>
    <style>
      canvas {
        border: 1px solid #ccc;
      }
    </style>
  </head>
  <body>
    <canvas id="pascal" width="300" height="300"></canvas>
    <script>
      const canvas = document.getElementById('pascal');

      const context = canvas.getContext('2d');
      const scale = 10;

      for (let row = 0; row <= 8; row++) {
        const x = row * scale;
        const y = Math.floor(canvas.height / 2 - scale * (row + 1) / 2);

        context.beginPath();
        context.lineWidth = 1;
        context.strokeStyle = 'black';

        for (let col = 0; col <= 8 - row; col++) {
          const entry = row + col;
          const entryValue = Math.pow(2, entry);

          const SCALE = 0.1;
          const xEntry = x + col * scale * SCALE;
          const yEntry = y + entry * scale * SCALE;

          context.moveTo(xEntry, yEntry);
          context.lineTo(xEntry - 10 * SCALE, yEntry);
          context.stroke();

          context.beginPath();
          context.arc(xEntry, yEntry, 4 * SCALE, 0, Math.PI * 2, false);
          context.fillStyle = 'pink';
          context.fill();
        }
        context.stroke();
      }
    </script>
  </body>
</html>
```
